// SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "./SyndicateClosedEndFundStoreV0.sol";
import "./SyndicateOwnerLogic.sol";

/// @author Syndicate Inc.
/// @notice Abstract contract for common logic needs
abstract contract SyndicateClosedEndFundLogic is
    ReentrancyGuard,
    SyndicateOwnerLogic
{
    // Private Data + Constructor------------------------------------------------

    SyndicateClosedEndFundStoreV0 internal store;

    constructor(address owner, address storeAddress)
        ReentrancyGuard()
        SyndicateOwnerLogic(owner)
    {
        store = SyndicateClosedEndFundStoreV0(storeAddress);
    }

    // Modifiers---------------------------------------------------------------

    // Identity checks:

    /// @notice Only proceed if the msg.sender is the current manager
    modifier onlyManager(address syndicateAddress) {
        _isManager(syndicateAddress);
        _;
    }

    function _isManager(address syndicateAddress) internal view {
        require(
            msg.sender == store.managerCurrent(syndicateAddress),
            "SDR_NOT_MGR"
        );
    }

    /// @notice Only proceed if the msg.sender is not the current manager
    modifier onlyNotManager(address syndicateAddress) {
        _isOnlyNotManager(syndicateAddress);
        _;
    }

    function _isOnlyNotManager(address syndicateAddress) internal view {
        require(
            msg.sender != store.managerCurrent(syndicateAddress),
            "SDR_NOT_MBR"
        );
    }

    // Syndicate life cycle (state) checks:

    /// @notice Only proceed if the Syndicate is allowing deposits
    modifier onlyBeforeDateClose(address syndicateAddress) {
        _isBeforeDateClose(syndicateAddress);
        _;
    }

    function _isBeforeDateClose(address syndicateAddress) internal view {
        require(
            store.dateClose(syndicateAddress) > block.timestamp,
            "PAST_CLOSE_DATE"
        );
    }

    /// @notice Only proceed if the Syndicate is open
    modifier onlyOpen(address syndicateAddress) {
        _isOpen(syndicateAddress);
        _;
    }

    function _isOpen(address syndicateAddress) internal view {
        require(store.open(syndicateAddress), "SYN_CLOSED");
    }

    /// @notice Only proceed if the Syndicate is closed
    modifier onlyClosed(address syndicateAddress) {
        _isClosed(syndicateAddress);
        _;
    }

    function _isClosed(address syndicateAddress) internal view {
        require(!store.open(syndicateAddress), "SYN_OPEN");
    }

    /// @notice Only proceed if distributions have not been enabled
    modifier onlyBeforeDistributing(address syndicateAddress) {
        _isBeforeDistributing(syndicateAddress);
        _;
    }

    function _isBeforeDistributing(address syndicateAddress) internal view {
        require(!store.distributing(syndicateAddress), "SYN_DISTRIBUTING");
    }

    // Syndicate attribute checks:

    /// @notice Only proceed if the allowlist is enabled
    modifier onlyAllowlistEnabled(address syndicateAddress) {
        _isAllowlistEnabled(syndicateAddress);
        _;
    }

    function _isAllowlistEnabled(address syndicateAddress) internal view {
        require(store.allowlistEnabled(syndicateAddress), "ALLOWLIST_DISABLED");
    }

    /// @notice If the allowlist is enabled, only proceed if the sender is on
    /// the allowlist.
    modifier enforceAllowlist(address syndicateAddress, address memberAddress) {
        _isAllowlistEnforced(syndicateAddress, memberAddress);
        _;
    }

    function _isAllowlistEnforced(
        address syndicateAddress,
        address memberAddress
    ) internal view {
        require(
            !store.allowlistEnabled(syndicateAddress) ||
                store.allowlist(syndicateAddress, memberAddress),
            "MBR_NOT_ALLOWED"
        );
    }

    /// @notice Only proceed if the Syndicate manager is allowed to modify
    /// deposits and claimed distributions for members
    modifier onlyModifiable(address syndicateAddress) {
        _isModifiable(syndicateAddress);
        _;
    }

    function _isModifiable(address syndicateAddress) internal view {
        require(store.modifiable(syndicateAddress), "SYN_NOT_MODIFIABLE");
    }

    /// @notice Only proceed if Syndicate members are allowed to transfer deposits
    modifier onlyTransferable(address syndicateAddress) {
        _isTransferable(syndicateAddress);
        _;
    }

    function _isTransferable(address syndicateAddress) internal view {
        require(store.transferable(syndicateAddress), "SYN_NOT_TRANSFERABLE");
    }

    // Syndicate contract permission checks:

    /// @notice Only proceed if a logic contract is allowed to call the data
    /// contract.
    /// @dev Is a replacement for `whenNotPaused()` and should be used for any
    /// logic function that touches ERC-20 transfers in case it actually doesn't
    /// follow the Checks-Effects-Interaction pattern.
    modifier onlyLogicContractAllowedGuard() {
        _isLogicContractAllowedGuard();
        _;
    }

    function _isLogicContractAllowedGuard() internal view {
        require(
            store.logicContractAllowed(address(this)),
            "INVALID_LOGIC_CONTRACT"
        );
    }
}

